BEGIN TRANSACTION;
CREATE TABLE IF NOT EXISTS "news" (
	"id"	INTEGER NOT NULL,
	"title"	VARCHAR(100),
	"descr"	VARCHAR(1000),
	"version"	VARCHAR(10),
	"create_date"	VARCHAR(25),
	"to_send"	BOOLEAN,
	PRIMARY KEY("id")
);
CREATE TABLE IF NOT EXISTS "tag" (
	"id"	INTEGER NOT NULL,
	"uid"	INTEGER,
	"ws_id"	INTEGER,
	"title"	VARCHAR(100),
	"descr"	VARCHAR(1000),
	PRIMARY KEY("id")
);
CREATE TABLE IF NOT EXISTS "to_do" (
	"id"	INTEGER NOT NULL,
	"title"	VARCHAR(100),
	"tag_id"	INTEGER,
	"descr"	VARCHAR(1000),
	"create_date"	DATETIME,
	"close_date"	DATETIME,
	"is_complete"	BOOLEAN,
	"is_cycle"	VARCHAR(25),
	"cycle_series"	INTEGER,
	"time_to_complete"	VARCHAR(100),
	"responsible"	INTEGER,
	PRIMARY KEY("id")
);
CREATE TABLE IF NOT EXISTS "users" (
	"id"	INTEGER NOT NULL,
	"username"	VARCHAR(100),
	"email"	VARCHAR(100),
	"password"	VARCHAR(100),
	"register_date"	VARCHAR(100),
	"avatar"	BLOB,
	PRIMARY KEY("id")
);
CREATE TABLE IF NOT EXISTS "workspace" (
	"id"	INTEGER NOT NULL,
	"uid"	INTEGER,
	"title"	VARCHAR(100),
	"descr"	VARCHAR(1000),
	PRIMARY KEY("id")
);
INSERT INTO "news" VALUES (1,'Добавлена система статистики по задачам','Система включает в себя что-то','0.24','2025-01-12 00:00:00',1);
INSERT INTO "news" VALUES (2,'Были добавлены цикличные задачи','<p>С данной версии появилась возможность создавать задачи, статус которых сбрасывается ежедневно(в GMT+0).<br />
Чтобы активировать такую функцию на задаче можно:</p>

<ul>
	<li>Создать новую задачу и установить галочку в соответствующем поле</li>
	<li>Изменить существующую задачу и установить галочку в соответствующем поле</li>
</ul>

<p><br />
Подробнее об использовании и управлении такими задачами в нашем девлоге:<br />
<a href="https://youtu.be/bL_BL44u794" target="Video">Devlog v0.28</a></p>
','0.28','2025-01-14 00:10:15.499776',0);
