','2025-01-13 21:30:50.944799','2025-01-14 21:03:21.495452',1,NULL,NULL,NULL,NULL, NULL);
INSERT INTO "to_do" VALUES (58,'Добавить воркплейсы',6,'<p>Юзер должен иметь возможность создавать воркплейсы и создавать проекты внутри этих воркплейсов. Внутри проектов будут задачи</p>
','2025-01-13 21:31:15.084667','2025-01-20 08:30:28.661781',1,NULL,NULL,NULL,NULL, NULL);
INSERT INTO "to_do" VALUES (59,'<s>Добавить серию выполнения цикличных задач</s>',6,'<p>Если в течение 24 часов статус задачи не меняется, серия сбрасывается</p>
','2025-01-13 21:31:46.405239','2025-01-14 21:44:00.170915',1,NULL,NULL,NULL,NULL, NULL);
INSERT INTO "to_do" VALUES (60,'Подсказки по функционалу при наведению на кнопки',6,'<p>Допустим может быть не до конца понятно что такое &quot;Цикличная&quot; задача. При наведении на чекбокс, должно появляться всплывающее окно, которое объясняет что это такое.<br />
<br />
Подсказки можно отключить в настройках</p>
','2025-01-13 21:32:38.807578',NULL,0,NULL,NULL,NULL,NULL, NULL);
INSERT INTO "to_do" VALUES (61,'Создать систему ответственных',8,'<p>По проектам:<br />
К одному проекту может быть прикреплено несколько человек и они должны видеть все задачи по этому проекту, независимо от того, назначены ли они ответственными в каких-то из этих задач<br />
<br />
По задачам:<br />
В окне изменения задачи можно либо сменить ответственного, либо добавить еще одного(по адресу электронной почты)</p>
','2025-01-14 20:21:09.738684','2025-01-14 18:51:39.369287',0,NULL,NULL,NULL,NULL, NULL);
