INSERT INTO "to_do" VALUES (78,'Блок задачи',8,'<p>У карточки задачи должно быть:<br />
1. Цветная линия над названием задачи. Цвет линии означает статус задачи(в работе/завершена)<br />
2. Список тегов под названием задачи. Текст тега имеет цветную обводку. Цвет обводки задает пользователь при создании тега.<br />
3. Аватар пользователя, который создал задачу.<br />
4. Если пользователь назначил другого пользователя ответственным в задаче, рядом с аватаром пользователя должен быть так же аватар ответственного за задачу.<br />
5. Если в задаче есть чек-лист, справа от цветной линии должен выводиться процент завершенности задачи.<br />
<br />
В итоге мы должны получить карточку задачи как в фигме</p>
','2025-02-06 21:36:07.356555',NULL,0,NULL,NULL,NULL,NULL, NULL);
INSERT INTO "to_do" VALUES (79,'Изменение темы',6,'<p>Пользователь должен иметь возможность менять тему приложения в настройках(выезжающее меню слева от иконки профиля).<br />
С темой приложения меняется фон. Фон сохраняется в таблицу пользователя как выбранный(по нему и определяется тема, костыль, потом поправлю)</p>
','2025-02-06 21:36:07.356555',NULL,0,NULL,NULL,NULL,NULL, NULL);
